import { useState } from "react";
import Container from "react-bootstrap/Container";
import Button from "react-bootstrap/Button";
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";

function NavMenu() {
  const [expanded, setExpanded] = useState(false);

  return (
    <Navbar expand="lg" className="custom-navbar" expanded={expanded}>
      <Container fluid className="d-flex align-items-center py-0 p-0 m-0">
        {/* Logo */}
        <Navbar.Brand href="#">
          <img src="/images/actual-logo.png" alt="Site Logo" width="232" />
        </Navbar.Brand>

        {/* Hamburger Toggle */}
        <Navbar.Toggle
          aria-controls="navbar-nav"
          className="custom-toggler"
          onClick={() => setExpanded(!expanded)}
        />

        {/* Collapsible Menu */}
        <Navbar.Collapse id="navbar-nav">
          <Nav className="ms-auto d-flex flex-column flex-lg-row w-100">
            <Button
              variant="outline-info"
              size="lg"
              className="flex-grow-1 py-3 mb-2 mb-lg-0 button-text no-round"
            >
              CODING
            </Button>
            <Button
              variant="outline-success"
              size="lg"
              className="flex-grow-1 py-3 mb-2 mb-lg-0 button-text no-round"
            >
              COMICS
            </Button>
            <Button
              variant="outline-danger"
              size="lg"
              className="flex-grow-1 py-3 mb-2 mb-lg-0 button-text no-round"
            >
              CONTACT
            </Button>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default NavMenu;
